import React from 'react';
//* {`${libraryStatus ? 'library-active' : ''}`}
const Song = ({ currentSong, weatherdata }) => {
  const starterImgWithoutCurrentSongCoverFunction = () => {
    if (weatherdata === true) {
      return `${currentSong.cover}`;
    }
  };

  console.log(currentSong);
  console.log(
    'mystarterImgFunction: ',
    starterImgWithoutCurrentSongCoverFunction()
  );

  return (
    <div className="song-container">
      <img
        lat={currentSong.name}
        src={starterImgWithoutCurrentSongCoverFunction()}
        alt="coverArtwork"
      ></img>
      <h2>{currentSong.name}</h2>
      <h3>{currentSong.artist}</h3>
    </div>
  );
};

export default Song;
